class Twitter:

    def __init__(self):
        self.tweets = {}
        self.users = set()

    def postTweet(self, userId: int, tweetId: int) -> None:
        self.tweets[tweetId] = Tweet("user" + str(userId), "tweet " + str(tweetId), int(time.time()))
        self.users.add("user" + str(userId))

    def getNewsFeed(self, userId: int) -> List[str]:
        feed = []
        for tweetId in self.tweets.keys():
            if self.tweets[tweetId].user in self.users & {"user" + str(userId)}:
                feed.append(self.tweets[tweetId].text)
        return feed[::-1][:10]

    def follow(self, followerId: int, followeeId: int) -> None:
        if "user" + str(followeeId) not in self.users:
            self.postTweet(followeeId, 0)
        if "user" + str(followerId) not in self.tweets:
            self.postTweet(followerId, 0)
        self.users.add("user" + str(followerId))
        self.users.add("user" + str(followeeId))

    def unfollow(self, followerId: int, followeeId: int) -> None:
        self.users.discard("user" + str(followeeId))

